import React, { useState } from "react";
import "./style.scss";

const Layout = () => {
  const [count, setCount] = useState(0);

  return (
    <div>
      {count}
      <button onClick={() => setCount(count + 1)}>Click Me</button>
    </div>
  );
};

export default Layout;
